import React, { Component } from 'react';
import Pokecard from './Pokecard';

class App extends Component {
  render() {
    return (
      <div>
        <Pokecard id={4} name={'Eevee'} type="normal" exp="65" />
      </div>
    );
  }
}

export default App;
